// App.js
import React from 'react';
import './App.css';
import LoginPage from './LoginPage'; // Import the LoginPage component

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* You can keep your logo and other elements here */}
      </header>
      <main>
        <LoginPage /> {/* Render the LoginPage component */}
      </main>
    </div>
  );
}

export default App;
